import React from "react";
import "./CallButton.css"; // Đảm bảo rằng bạn có file CSS cho nút này

const CallButton = () => {
  const phoneNumber1 = "0909260991"; // Số điện thoại 1
  const phoneNumber2 = "0912345678"; // Số điện thoại 2

  return (
    <div className="call-buttons-container">
      {/* Nút gọi 1 */}
      <a href={`tel:${phoneNumber1}`} className="call-button">
        <img src="/images/icon_email.png" alt="Call" /> {/* Đường dẫn tới biểu tượng */}
      </a>

      {/* Nút gọi 2 */}
      <a href={`tel:${phoneNumber2}`} className="call-button">
        <img src="/images/icon_phone.png" alt="Call" /> {/* Đường dẫn tới biểu tượng */}
      </a>
    </div>
  );
};

export default CallButton;
